import React, { useState } from 'react';
import styled from 'styled-components';
import { proposeAction } from '../services/api';

const FormContainer = styled.div`
  background-color: ${props => props.theme.colors.background};
  border: 1px solid ${props => props.theme.colors.border};
  border-radius: ${props => props.theme.borderRadius};
  padding: ${props => props.theme.space.large};
  margin-bottom: ${props => props.theme.space.large};
  box-shadow: ${props => props.theme.boxShadow};
`;

const Title = styled.h2`
  color: ${props => props.theme.colors.secondary};
  margin-bottom: ${props => props.theme.space.medium};
`;

const Form = styled.form`
  display: flex;
  flex-direction: column;
`;

const Label = styled.label`
  margin-bottom: ${props => props.theme.space.small};
  color: ${props => props.theme.colors.text};
`;

const Input = styled.input`
  margin-bottom: ${props => props.theme.space.medium};
  padding: ${props => props.theme.space.small};
  border: 1px solid ${props => props.theme.colors.primary};
  border-radius: ${props => props.theme.borderRadius};
`;

const Select = styled.select`
  margin-bottom: ${props => props.theme.space.medium};
  padding: ${props => props.theme.space.small};
  border: 1px solid ${props => props.theme.colors.primary};
  border-radius: ${props => props.theme.borderRadius};
`;

const SubmitButton = styled.button`
  background-color: ${props => props.theme.colors.secondary};
  color: ${props => props.theme.colors.white};
  padding: ${props => props.theme.space.small} ${props => props.theme.space.medium};
  border: none;
  border-radius: ${props => props.theme.borderRadius};
  cursor: pointer;

  &:hover {
    opacity: 0.8;
  }
`;

function ProposeActionForm({ onActionProposed }) {
    const [actionTitle, setActionTitle] = useState('');
    const [actionType, setActionType] = useState('bet');
    const [betAmount, setBetAmount] = useState(0);
    const [error, setError] = useState(null);
    const [success, setSuccess] = useState(false);

    const handleSubmit = async (e) => {
        e.preventDefault();
        setError(null);
        setSuccess(false);

        try {
            const response = await proposeAction({ actionTitle, actionType, betAmount });
            console.log('Action proposed:', response);
            setSuccess(true);
            setActionTitle('');
            setActionType('bet');
            setBetAmount(0);
            if (onActionProposed) onActionProposed();  // Call this to refresh the pending actions list
        } catch (err) {
            console.error("Error proposing action:", err);
            setError(`Failed to propose action: ${err.message}`);
        }
    };

    return (
        <FormContainer>
            <Title>Propose Action</Title>
            {error && <p style={{ color: 'red' }}>{error}</p>}
            {success && <p style={{ color: 'green' }}>Action proposed successfully!</p>}
            <Form onSubmit={handleSubmit}>
                <Label htmlFor="actionTitle">Action Title:</Label>
                <Input
                    type="text"
                    id="actionTitle"
                    value={actionTitle}
                    onChange={(e) => setActionTitle(e.target.value)}
                    required
                />
                <Label htmlFor="actionType">Action Type:</Label>
                <Select
                    id="actionType"
                    value={actionType}
                    onChange={(e) => setActionType(e.target.value)}
                >
                    <option value="bet">Bet</option>
                    <option value="fold">Fold</option>
                    {/* Add more action types as needed */}
                </Select>
                <Label htmlFor="betAmount">Bet Amount:</Label>
                <Input
                    type="number"
                    id="betAmount"
                    value={betAmount}
                    onChange={(e) => setBetAmount(Number(e.target.value))}
                    min="0"
                />
                <SubmitButton type="submit">Propose Action</SubmitButton>
            </Form>
        </FormContainer>
    );
}

export default ProposeActionForm;
